Actionscript.script:
攻击时移动 = _root.敌人二级函数.攻击时移动;

攻击时四向移动 = _root.敌人二级函数.攻击时四向移动;
function 近战冲伤攻击(倍率,Z轴攻击范围,击倒率,水平击退速度)
{
	子弹属性 = _root.子弹属性初始化(this.攻击点);

	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 1;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 = _parent.空手攻击力 * 倍率;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = Z轴攻击范围 ? Z轴攻击范围 : 35;
	子弹属性.击倒率 = 击倒率? 击倒率 :10;

	if(水平击退速度){
		子弹属性.水平击退速度 = 水平击退速度;
	}

	子弹属性.伤害类型 = "魔法";
	子弹属性.魔法伤害属性 = "冲";

	子弹属性.区域定位area = this.攻击点;

	_root.子弹区域shoot传递(子弹属性);
}
gotoAndPlay(_parent.近战招式);

if(_root.gameworld[_parent.攻击目标].hp> 0 ){
	距离X= _root.gameworld[_parent.攻击目标]._x - _parent._x ;
	if(距离X>0){
		_parent.方向改变("右");
	}else{
		_parent.方向改变("左");
	}
}

onClipEvent (load) {
    // 1) 初始化属性对象（会预填 发射者 / 坐标 等常用字段）
    var 子弹属性:Object = _root.子弹属性初始化(this);

    // 2) 迁移旧参数（仅填变化项，其余走初始化默认）
    子弹属性.声音 = "";
    子弹属性.霰弹值 = 1;
    子弹属性.子弹散射度 = 0;
    子弹属性.发射效果 = "";
    子弹属性.子弹种类 = "近战子弹";
    子弹属性.子弹威力 = _parent._parent.空手攻击力 * 3;
    子弹属性.子弹速度 = 0;
    子弹属性.击中地图效果 = "";
    子弹属性.Z轴攻击范围 = 30;
    子弹属性.击倒率 = 1;
    子弹属性.击中后子弹的效果 = "空手攻击火花";

    // 3) 发射者 & 坐标（严格复刻旧写法的坐标换算）
    var myPoint:Object = { x: this._x, y: this._y };
    _parent.localToGlobal(myPoint);
    _root.gameworld.globalToLocal(myPoint);

    子弹属性.shootX = myPoint.x;
    子弹属性.shootY = myPoint.y;
    子弹属性.shootZ = _parent._parent.Z轴坐标;
    子弹属性.发射者 = _parent._parent._name;

	子弹属性.伤害类型 = "破击";
	子弹属性.魔法伤害属性 = "首领";

    // 说明：旧代码里的“子弹敌我属性”新版通常由 发射者/阵营 在传递侧推断。
    // 若项目仍需手动强制，可在这里按需扩展自定义标记并在 shoot传递 里处理。

    // 4) 交由统一入口
    _root.子弹区域shoot传递(子弹属性);
}

