//本帧是锁定敌人位置的帧，建议比位移元件早一些。

//你需要改的值，追踪持续帧是从挂载ef的位移元件的第二帧到预计实际到达敌人位置时的总帧数。
速度上限 = _parent.行走X速度 * 7;
速度下限 = _parent.行走X速度 * 1;
追踪持续帧 = 13;

//自动计算的值
敌方目标 = _root.gameworld[_parent.攻击目标];
上速度 = 0;
下速度 = 0;
左速度 = 0;
右速度 = 0;
距离X = _parent._x - 敌方目标._x;
速度X = Math.min(Math.max(距离X / 追踪持续帧, -速度上限), 速度上限);

if (速度X >= 0)
{
	速度X = Math.max(速度X, 速度下限);
	左速度 = 速度X;
}
else
{
	速度X = Math.min(速度X, -速度下限);
	右速度 = -速度X;
}
/* //如果打算给予Z轴位移能力，启用以下代码，但需谨慎给予。
距离Z = _parent.Z轴坐标 - 敌方目标.Z轴坐标;
速度Z = 速度X * 距离Z / 距离X;
if (速度Z >= 0)
{
	上速度 = Math.min(速度Z, 速度上限 * 1);
}
else
{
	下速度 = Math.min(-速度Z, 速度上限 * 1);
}
*/

onClipEvent (load) {
    // 1) 初始化属性对象（会预填 发射者 / 坐标 等常用字段）
    var 子弹属性:Object = _root.子弹属性初始化(this);

    // 2) 迁移旧参数（仅填变化项，其余走初始化默认）
    子弹属性.声音 = "";
    子弹属性.霰弹值 = 1;
    子弹属性.子弹散射度 = 0;
    子弹属性.发射效果 = "";
    子弹属性.子弹种类 = "近战子弹";
    子弹属性.子弹威力 = _parent._parent.空手攻击力 * 5;
    子弹属性.子弹速度 = 0;
    子弹属性.击中地图效果 = "";
    子弹属性.Z轴攻击范围 = 30;
    子弹属性.击倒率 = 1;
    子弹属性.击中后子弹的效果 = "空手攻击火花";

    // 3) 发射者 & 坐标（严格复刻旧写法的坐标换算）
    var myPoint:Object = { x: this._x, y: this._y };
    _parent.localToGlobal(myPoint);
    _root.gameworld.globalToLocal(myPoint);

    子弹属性.shootX = myPoint.x;
    子弹属性.shootY = myPoint.y;
    子弹属性.shootZ = _parent._parent.Z轴坐标;
    子弹属性.发射者 = _parent._parent._name;

	子弹属性.伤害类型 = "破击";
	子弹属性.魔法伤害属性 = "首领";

    // 说明：旧代码里的“子弹敌我属性”新版通常由 发射者/阵营 在传递侧推断。
    // 若项目仍需手动强制，可在这里按需扩展自定义标记并在 shoot传递 里处理。

    // 4) 交由统一入口
    _root.子弹区域shoot传递(子弹属性);
}

