onClipEvent(load){
   if(_parent._parent.方向 == "右")
   {
      移动距离 = Math.abs(_parent._parent._x - _root.gameworld[_parent._parent.攻击目标]._x) - 80;
   }
   else if(_parent._parent.方向 == "左")
   {
      移动距离 = Math.abs(_parent._parent._x - _root.gameworld[_parent._parent.攻击目标]._x) - 80;
   }
   _parent.攻击时移动(移动距离,移动距离);
}

